      <p>Unlock Exclusive Access to Begin Your Journey</p>
      <h3>Join Us Today & Dive into a World of Boundless Discoveries.</h3>
    </div>
    <div className="gpt3__cta-btn">
      <button type="button">Start Exploring</button>
    </div>
  </div>
);

